INSERT INTO `acts` VALUES (1,1,1,'2016-02-07 04:08:24','2016-02-07 19:37:27','Exposition: Duke has died, and there has been a military victory (these events are possibly related). \nThe Cardinal and Ferdinand tell the Duchess not to marry again. She immediately marries Antonio, her household steward.'),(2,2,1,'2016-02-07 04:08:24','2016-02-07 19:38:09','The Duchess gives birth to a son. Antonio drops the baby\'s horoscope and Bosola finds it. He sends a letter to the Cardinal and Ferdinand, who are very upset.'),(3,3,1,'2016-02-07 04:10:35','2016-02-07 19:40:27','Ferdinand comes to the Duchess\' palace. He sneaks into her bedroom and threatens her with his poniard. Frightened, the Duchess pretends to banish Antonio. She follows him, and they are both banished from Ancona. They separate, hoping to improve their chances of at least one surviving. The Duchess is captured and returned to her palace, now a prison.'),(4,4,1,'2016-02-07 04:10:35','2016-02-07 19:41:44','Ferdinand visits the Duchess and shows her wax figures which he claims are Antonio and their son\'s dead bodies. He tortures the Duchess and eventually has her, Cariola, and the babies executed. He then goes mad with grief and regret.'),(5,5,1,'2016-02-07 04:10:35','2016-02-07 19:43:23','Antonio and Delio go to the Cardinal\'s palace, hoping to be reconciled to him. Ferdinand is kept there, undergoing treatment for lycanthropia. Nearly everyone dies. Delio ends the play by asking that Antonio\'s son be set up as the new duke.'),(6,1,2,'2016-02-07 22:40:47','2016-02-07 22:40:47','');
/*!40000 ALTER TABLE `acts` ENABLE KEYS */;
