INSERT INTO `authors` VALUES (1,'John','Webster','1580-01-01','1634-01-01','Contemporary of Shakespeare\'s, few surviving plays or details.','2016-02-07 03:56:16','2016-02-07 03:56:16'),(2,'Tom','Stoppard','1937-07-03',NULL,'Sir Tom Stoppard is a British playwright and screenwriter, knighted in 1997. He has written prolifically for TV, radio, film and stage, finding prominence with plays such as Arcadia, The Coast of Utopia, Every Good Boy Deserves Favour, Professional Foul, The Real Thing, and Rosencrantz and Guildenstern Are Dead. He co-wrote the screenplays for Brazil, The Russia House, and Shakespeare in Love, and has received one Academy Award and four Tony Awards. Themes of human rights, censorship and political freedom pervade his work along with exploration of linguistics and philosophy. Stoppard has been a key playwright of the National Theatre and is one of the most internationally performed dramatists of his generation.\r\n\r\nBorn in Czechoslovakia, Stoppard left as a child refugee, fleeing imminent Nazi occupation. He settled with his family in Britain after the war, in 1946, having spent the three years prior (1943â€“46) in a boarding school in Darjeeling in the Indian Himalayas. After being educated at schools in Nottingham and Yorkshire, Stoppard became a journalist, a drama critic and then, in 1960, a playwright. He has been married three times, to Josie Ingle (m. 1965), then Miriam Stoppard (m. 1972), and Sabrina Guinness (m. 2014).','2016-02-07 22:27:25','2016-02-07 22:27:25');
/*!40000 ALTER TABLE `authors` ENABLE KEYS */;
