INSERT INTO `plays` VALUES (1,'The Duchess of Malfi','1612-01-01',1,'2016-02-07 04:08:09','2016-02-07 19:19:42',1,'A love story wrapped in a Halloween story.','Ed. Leah S. Marcus. London: Arden Early Modern Drama, 2009.'),(2,'The Real Inspector Hound','1968-01-01',2,'2016-02-07 22:31:29','2016-02-07 22:31:29',1,' The plot follows two theatre critics named Moon and Birdboot who are watching a ludicrous setup of a country house murder mystery, in the style of a whodunit. By chance, they become involved in the action causing a series of events that parallel the play they are watching.','The Real Inspector Hound and Other Plays. New York: Grove, 1996. Print.');
