INSERT INTO `scenes` VALUES (1,1,'2016-02-07 04:08:24','2016-02-07 19:46:17',1,'Antonio reports on his trip to France. Bosola accuses the Cardinal of mistreating him.'),(2,1,'2016-02-07 04:08:24','2016-02-07 19:49:55',2,'Bosola, suspecting the Duchess is pregnant, gives her green apricots. The Duchess goes into labor.'),(3,2,'2016-02-07 04:10:35','2016-02-07 19:48:29',1,'Antonio reports on the characters of the Cardinal, Ferdinand, and the Duchess. Ferdinand employs Bosola to be his spy. Ferdinand and the Cardinal lecture the Duchess about not remarrying. The Duchess and Antonio get married.'),(4,2,'2016-02-07 04:10:35','2016-02-07 19:50:55',2,'Antonio orders that everyone go lock themselves in their bedrooms. He says that the Duchess has been poisoned. Cariola brings Antonio news that the Duchess has given birth to a son.'),(5,3,'2016-02-07 04:10:35','2016-02-07 19:51:39',2,'Bosola and Antonio encounter each other in the dark house. They each accuse the other of being dishonest and sneaky. Antonio drops the baby\'s horoscope, which Bosola finds.'),(6,4,'2016-02-07 04:10:35','2016-02-07 19:52:19',2,'The Cardinal and Julia are interrupted in their lovemaking by a visit from Delio, who brings word that Ferdinand has received an upsetting letter.'),(7,5,'2016-02-07 04:10:35','2016-02-07 19:52:41',2,'Ferdinand and the Cardinal discuss Bosola\'s letter, which reveals that the Duchess has had a baby.'),(8,1,'2016-02-07 04:10:35','2016-02-07 20:09:59',3,'Delio and Ferdinand have come to Malfi. Ferdinand gets a key to the Duchess\' chambers.'),(9,2,'2016-02-07 04:10:35','2016-02-07 20:11:34',3,'Antonio, Cariola, and the Duchess are getting ready for bed. Antonio and Cariola sneak out to play a trick on the Duchess, and Ferdinand sneaks in. He threatens her with his poniard. She tells him that she is married, and he gets very upset. After he storms out, Bosola comes in to find out what is going on. The Duchess sends Antonio away, to protect him. She confides in Bosola, who recommends that she feign a pilgrimage to Loretto.'),(10,3,'2016-02-07 04:10:35','2016-02-07 20:13:00',3,'The Cardinal receives an order to become a military general. As he\'s discussing this with his friends, Bosola enters and reports on the Duchess\' plans.'),(11,4,'2016-02-07 04:10:35','2016-02-07 20:13:51',3,'DUMBSHOW: At the shrine of Loretto, the Cardinal lays aside his religious robes and puts on armor. He then (with assistance from the pope) banishes the Duchess from Ancona.'),(12,5,'2016-02-07 04:10:35','2016-02-07 20:15:45',3,'On the road outside of Loretto, Bosola overtakes the Duchess and family with a letter from Ferdinand. Suspecting a trap, the Duchess sends Antonio and their oldest son away. She, Cariola, and the younger two children are captured by a disguised Bosola and taken to her palace.'),(13,1,'2016-02-07 04:10:35','2016-02-07 20:16:46',4,'Ferdinand meets the Duchess in darkness and gives her a severed hand he claims is Antonio\'s. He then shows her two dummies that he claims are Antonio and their son.'),(14,2,'2016-02-07 04:10:35','2016-02-07 20:18:09',4,'Ferdinand sends local madmen to dance and cavort before the Duchess. Then Bosola and executioners kill her, Cariola, and the babies. Ferdinand goes mad with grief and regret when he sees the Duchess\' body.'),(15,1,'2016-02-07 04:10:35','2016-02-07 20:21:01',5,'Delio asks Pescara for a citadel that belonged to Antonio. Pescara denies him and gives it to Julia, saying that it is not a noble gift, because it was stolen.'),(16,2,'2016-02-07 04:10:35','2016-02-07 20:22:57',5,'Ferdinand has gone mad, and a Doctor has come in to treat him. The court is generally very worried. Julia declares her love for Bosola and, as a favor to him, pressures the Cardinal into confessing to murdering the Duchess. The Cardinal makes her swear to secrecy on a poisoned Bible.'),(17,3,'2016-02-07 04:10:35','2016-02-07 20:23:44',5,'Antonio hears an Echo that sounds oddly like the Duchess, warning him to be careful for his life.'),(18,4,'2016-02-07 04:10:35','2016-02-07 20:24:21',5,'Believing that he\'s killing the Cardinal, Bosola makes a stab in the dark and kills Antonio instead.'),(19,5,'2016-02-07 04:10:35','2016-02-07 20:25:42',5,'Bosola attacks the Cardinal. Ferdinand comes in and, in his madness, stabs the Cardinal. He and Bosola stab each other. Delio comes in with Antonio\'s son and declares him the Duchess\' heir.'),(20,1,'2016-02-07 22:40:47','2016-02-07 22:40:47',6,'');
/*!40000 ALTER TABLE `scenes` ENABLE KEYS */;
UNLOCK TABLES;

